import React from "react";
import { useState, useEffect } from "react";

import { usePlacesList } from "../placesContext";
import '../styles/graphic.css'
import Chart from "../components/Chart";
import Assessment from "../components/Assessment";
import Diagnostic from "../components/Diagnostic";

import { useKeenSlider } from "keen-slider/react";
import "keen-slider/keen-slider.min.css";

export default function Graphic() {
 
   const [state, setState] = useState('0')

   const places = usePlacesList()

  const [sliderRef] = useKeenSlider({
    loop: true,
    mode: "free-snap",
    slides: {
      perView: 3,
      spacing: 15,
    },
    renderMode: "performance",
    created: (instance) => {
      // Custom 3D effect
      instance.on("detailsChanged", (s) => {
        s.slides.forEach((slide) => {
          const distance = Math.abs(s.details().relativeSlide - slide.index);
          const scale = Math.max(0.7, 1 - distance * 0.1);
          slide.element.style.transform = `scale(${scale})`;
          slide.element.style.opacity = `${1 - distance * 0.2}`;
        });
      });
    },
  });




    return(<>


    <div className="grafalign" id="ifos">
  <div className="abas">
     <div ref={sliderRef} className="keen-slider">
      {places.map((place) => (
        <div
          key={place.id}
          className="keen-slider__slide place-slide"
          onClick={() => setState(place.id)}
        >
          <h1>{place.name}</h1>
        </div>
      ))}
    </div>
       </div>



  <div className="container">
   
    <div className="linha-graficos firtsGrafic">
   <div className="card">
  <h2>Temperatura - Última Semana</h2>
  <p className="data-info">Dados diários - 7 entradas</p>
  <div className="graphic">
    <Chart id={state} dataKey="mediatemp" date='week' />
  </div>
</div>
 

  <div className="card">
    <h2>Temperatura - Último Mês</h2>
    <p className="data-info">Dados diários - 30 entradas</p>
    <div className="graphic">
      <Chart id={state} dataKey="mediatempdiaria" date='month' />
    </div>
  </div>
</div>
    <div className="avaliacoes">
    <Assessment id={state} dataKey={'mediatemp'} date={'week'}/>
    <Assessment id={state} dataKey={'mediatempdiaria'} date={'month'}/>
    </div>
    <div className="linha-graficos">
      <div className="card">
        <h2>Umidade - Última Semana</h2>
        <p className="data-info">Dados diários - 7 entradas</p>
        <div className="graphic">
          <Chart id={state} dataKey="mediahum" date='week' />
        </div>
      </div>


      <div className="card">
        <h2>Umidade - Último Mes</h2>
        <p className="data-info">Dados diários - 30 entradas</p>
        <div className="graphic">
          <Chart id={state} dataKey="mediahumdiaria" date='month' />
        </div>
      </div>
    </div>
   <div className="avaliacoes">
    <Assessment id={state} dataKey={'mediahum'} date={'week'}/>
    <Assessment id={state} dataKey={'mediahumdiaria'} date={'month'}/> 
 </div>
    <div className="linha-graficos">
      <div className="card">
        <h2>Qualidade do Ar - Último Mês</h2>
        <p className="data-info">Dados diários - 7 entradas</p>
        <div className="grafico-barras" aria-label="Gráfico de qualidade do ar do último mês" role="img">
          
        </div>
      </div>


      <div className="card">
        <h2>Qualidade do Ar - Última Semana</h2>
        <p className="data-info">Dados diários - 30 entradas</p>
        <div className="grafico-barras" aria-label="Gráfico de qualidade do ar da última semana" role="img">
          
        </div>
      </div>
    </div>
   <div className="avaliacoes">
   <Assessment id={state} dataKey={'mediatemp'} date={'month'}/> 
   <Assessment id={state} dataKey={'mediatemp'} date={'month'}/>
    </div>
      <Diagnostic id={state}/>



  </div>
  </div>
 
    </>)
}
